[cloudbridge]
LOOKUP-cbAppNameLookup = CloudBridgeAppNameLookup deviceInstanceId AS deviceInstanceId appNameAppId AS appNameAppId OUTPUTNEW appName AS appName
LOOKUP-cbTemplateNameLookup = TemplateNameLookup Template AS Template OUTPUTNEW TemplateName AS TemplateName
LOOKUP-cbClientTypeLookup = ClientTypeLookup clientType as clientType OUTPUTNEW clientTypeString AS clientTypeString
LOOKUP-cbIcaChannelLookup = IcaChannelLookup channelId as channelId OUTPUTNEW channelIdText AS channelIdText
LOOKUP-cbIcaEncryptionLookup = IcaEncryptionLookup icaEncryptionLevel as icaEncryptionLevel OUTPUTNEW icaEncryptionLevelText AS icaEncryptionLevelText


